import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.jpeg'

function Home(){
  return (
    <section id="intro">
        <div className="intro_content">
            <span classname="mame"><h1>Rudraksha Singh</h1></span>
            <span className="webd">Web Developer</span>
            <span className="about"><br/>Welcome to my portfolio! I'm a web developer <br/> focused on front-end design and building clean,<br/> responsive interfaces. I also have knowledge <br/> of data structures and algorithms, helping me <br/> write efficient code. Check out my work, <br/>—I’d love to connect!</span>
        </div>
        <img src={imgme} alt="Me" className="photoofme" />
    </section>
  )
}

export default Home;
